import "./App.css";
import Header from "./components/Header";
import LoginPage from "./Pages/login";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header />
      <Routes>
        <Route>
          <LoginPage />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
